Here is another design principle worth knowing about. Look at this image, part of a screenshot of one way to style the text on the page: text in vertical rhythm layout The principle here is that we imagine a grid with 20px high lines, and lay out everything according to that. Under resources/baseline.png there is an image 1px wide and 20px high with the last pixel coloured pink. Download that image to the folder with the HTML file and set body { background-image: url("baseline.png");
} This will make the image repeat horizontally and vertically, and you can now see the design behind this approach: text in vertical rhythm layout The baselines of the paragraph text all sit on the grid lines. The important thing here is that when a heading interrupts the flow of text, the total height of the heading is an exact multiple of the grid height, even if the font size is different. Try and recreate this layout or a similar one using vertical rhythm, starting from the reset stylesheet so you have to do everything yourself from scratch. Notes: The aim is that all paragraphs have their baselines on the grid, even if there are other elements (headlings, lists) earlier in the document. This means that the total height of headings must be an exact multiple of the grid size; you can assume that the text in a heading does not require more than one line. You should set all sizes, including margins and padding, in terms of relative units (either ems/rems or percentages). The base font size here is the default 16px. Start with the max-width and line-height from the first example, and modify the line height if necessary for your font to get the lines of paragraph text the right distance apart. The paragraphs themselves have a margin at the bottom (the empty line after the first paragraph) that also appears between paragraphs of text (not shown in the image) when one <p> tag follows another. You might also need to give them a small top padding to get the text on the lines, not between them. The shading around the headings is background-color: rgba(0, 0, 255, 0.25); to be semitransparent and let the lines show through, to see that while the heading text itself doesn't have to sit on a grid line, the total height of a heading including padding does respect the grid. However this shading is just to motivate the layout: if you want an actual coloured background, then you should set a padding-left: 0.5em; or something on the headings to make the text not start just on the 