e,ward_id which limits the fields in the response to those in which we are interested To test this I used variations of the above curl command, and looked at the output. Now that we understand the structure of the data returned from that endpoint, we can go ahead and write the populateWards function: function populateWards(wards) { let buttons = new DocumentFragment(); wards.records.forEach(w => { const [id, name] = [w.record.fields.ward_id, w.record.fields.name]; const b = document.createElement("button"); b.textContent = name; b.onclick = displayData(id, name); buttons.appendChild(b); }); let nav = document.getElementById("nav"); nav.textContent = ''; nav.append(buttons);
