The rest of script.js is concerned with displaying data about a given ward in the <main> section of the page. In fact, it consists of just one function, called displayData. Let us look at its structure, whilst eliding some of its implementation details: function displayData(id, name) { function buildPopulation(records) { ... } return function () { ... }
} When called with two arguments id and name, the function displayData does two things: It defines a nested function called buildPopulation. This is a function whose definition is local to displayData: it can only be used within its body, but not in the rest of the program. However, this function is allowed to refer to the arguments of its enclosing function (i.e. id and name). We sometimes call this an auxiliary function , or a helper function . It returns an anonymous arrow function . Thus, displayData will return... a newly defined, anonymous function! Recall that in the previous part of the script, displayData was used only in one line, namely b.onclick = displayData(id, name); b is a button, and its onclick property is a function that will be run when it is clicked. Thus, displayData should return a function. To construct such a function we need to know the id and name of the ward whose data is to be displayed, so displayData needs to take them as parameters. Both of these constitute examples of functional programming in action. Let us now look in more detail in the function that is returned: function displayData(id, name) { function buildPopulation(records) { ... } return function () { let wards = fetch(`https://opendata.bristol.gov.uk/api/v2/catalog/datasets/population-estimates-time-series-ward/records?limit=20&select=mid_year,population_estimate&refine=ward_2016_code:${id}`) .then(response => response.json()) .then(data => { let heading = document.createElement('h1'); heading.innerText = name; let population = buildPopulation(data.records); let dataPane = document.getElementById("dataPane"); dataPane.textContent = ''; dataPane.append(heading, population); }) .catch(err => console.log(err)); }
} The pattern here is much the same as before: an HTTP request is made, its response is parsed as JSON, and then processed. The endpoint is determined as before, but now asks for data from the population-estimates-time-series-ward dataset, which contains estimates of the population that lives in each Bristol ward. We extract only the mid_year and population_estimate fields, which contain the year in the middle of which the population is estimated, and the actual estimate itself. We also use a new feature of the API, namely the refine query parameter. This allows us to extract only records one of whose facets (i.e. fields of data) has a particular value. At this point in our code, we know the variable id holds the ID of the ward whose population we want to display, say E05010914 for Southville. By peeking in some sample data, we can work out that if we pass the query parameter refine=ward_2016_code:E05010914 we will only retrieve the population estimates for Southville. The value E050109141 is presumably stored in the id argument. However, id is a variable in our JavaScript program, so it needs to be turned into a string, which can then be spliced into the URL at the right position. Fortunately, modern versions of JavaScript provide a neat way of doing this, namely template literals . Instead of enclosing the URL string in single quotes as before, we now enclose it in backticks. Then, we can use any JavaScript expression e that evaluates to a string by writing ${e} directly in the URL string. Thus, `https://opendata.bristol.gov.uk/api/v2/catalog/datasets/population-estimates-time-series-ward/records?limit=20&select=mid_year,population_estimate&refine=ward_2016_code:${id}` evaluates to the correct string at runtime. The rest of the function is unremarkable. It creates an <h1> heading containing the name of the ward. Then, it calls the local function buildPopulation, passing the records in the data returned by the HTTP request. The <main> tag is retrieved through its u