We are going to make a NameEditor component with an input field to change the name. However, the name belongs to the app component: this is the state lifting pattern in React, where if more than one component wants to 'share' some state, then you make a common parent component to hold the state. Any changing of the state has to happen on the parent component that 'owns' it, so we have to create functions to pass it around correctly. First, create a new component like this: class NameEditor extends React.Component { render() { return ( <p> <label for="name">Name: </label> <input type="text" id="name" value={this.props.name} /> </p> ) }
} And change the render method of the App component to create a name editor: return ( <div> <NameEditor name={this.state.name} /> <NameGreeter name={this.state.name} /> </div>
) When you run this, it will show you an input box with the current name, but if you try and change it then React will change it straight back again. Input and output in React works with data binding : react maintains the correspondence between items on the screen (such as the input field) and its own state, but by default this only works in one way: React makes sure that the components on the screen reflect React's own state. To make the edit box work, we have to first create a function on the App component that allows the state to be updated: class App extends React.Component { constructor() { super(); this.onNameChange = this.onNameChange.bind(this); } onNameChange(newName) { this.setState({name: newName}) } // state and render method here, same as before
} The real work is happening in this.setState, we can't just do this.state.name = newName as that would not trigger React's updates. The setState function which is part of React, apart from setting the new state, also re-renders any component that needs to update itself. The constructor is just boilerplate code to correctly re-bind the this variable for onNameChange, you have to do this for every method you write in a React class. You also need to call the super() constructor explicitly at the start of the constructor, as this calls the React.Component constructor to set the component up correctly. We also have to let the name editor know which function to call to process changes. Change the JSX line that creates it to <NameEditor name={this.state.name} onNameChange={this.onNameChange} /> We did not put brackets after the function name, as we don't want to call the function when the component is created or rendered, we just want to tell it "here's a function that you can call later when you need it". Next, in the NameEditor class, we create a method to handle updates: constructor(props) { super(props); this.onNameChange = this.onNameChange.bind(this);
} onNameChange(e) { this.props.onNameChange(e.target.value);
} If our component takes props, then we should pass them to the super constructor too. The parameter e is an element of type event, which is triggered by the input component when the user changes its value. The event class has a property target which refers to the element on the page that triggered it, and if that was an input box like it is here then we can read its value. This is what we pass, via props, back to the App component. Finally, change the line that creates the input box to <input type="text" id="name" value={this.props.name} onChange={this.onNameChange} /> The onChange attribute of an <input> is defined in the HTML standard and takes a JavaScript function that should be called whenever the input value changes. With all this in place, you should be able to run the app and edit the text box, and watch the greeting change as you do this.

