On the server side, imagine a request comes in for a Region object. It looks like spring, hibernate and jackson (the library that produces JSON) should be able to handle this automatically, hibernate converting a database row in to a Java object and jackson converting that to a string containing JSON, with Spring making sure the correct classes are loaded in the first place. Unfortunately, the automatic approach assumes that there is only one way to deal with each domain class. If you can answer the question "if you load a region, do you want the counties or not?" once and for all in your application, then the automatic approach will work. However, When we are viewing a region, we do want to know the counties, as we want to show a clickable list of counties to the user. When we are viewing a country, we want to know the regions, but we do not care about the counties in the regions, and even less about the wards in the counties - otherwise a request for England would load the entire contents of the country, region, county and ward tables into memory all at once! The solution in this application is to use explict extents , that is for each object we declare when we fetch it what properties we do or don't want to see. The first step is to tell Hibernate not to do any joins unless told to, for example in the Region class with two FetchType.LAZY entries: // Region.java @ManyToOne(fetch = FetchType.LAZY) @JoinColumn(name="parent")
@JsonView(Region.class)
private Country parent; @OneToMany(fetch = FetchType.LAZY, mappedBy = "parent")
@JsonView(Region.class)
private List<County> counties; When we're fetching a region, the controller uses our own findByIdFull method: // RegionController.java @GetMapping(path="/api/region/{id}", produces="application/json")
String getRegionById(@PathVariable String id) { Region r = repository.findByIdFull(id); return ModelClass.renderJSON(r, Region.class, id);
} which has an annotation declaring its extent: // RegionRepository.java @Query("SELECT r FROM Region r JOIN FETCH r.parent LEFT JOIN FETCH r.counties WHERE r.id = ?1")
Region findByIdFull(String id); Here, we use HQL (Hibernate Query Language) JOIN FETCH to declare that when we're loading a region with this method, we want both the parent (country) and all the children (counties), but not for example the children of the children (wards) as they're not in the query. The ?1 at the end is HQL's way of doing a bound parameter for a prepared statement. The result is now that when we're trying to display a region, we get exactly the extent of information that we need to create the links, no more and no less. In contrast, when we're fetching a region through another query (e.g. to display a country) then the extent of that query will not load the region's children, as we don't need them.

