The problem is even more pronounced when converting to JSON, as when we are displaying a region we do not want this to happen: { "code":"E12000009", "name":"South West", "counties": [ {"code":"E06000022", "name":"Bath and North East Somerset", "parent":???} ... ]} A region countains counties (which we want to see to create the list), and those counties have parents, and their parents are regions. So what do we put for the parent of this county? It can't be a copy of the region otherwise we have created infinite recursion. JSON doesn't have a nice way to make a "pointer" back to the copy of the region we already have (which is how the problem is avoided for Java objects in memory). We can't say either that all objects should ignore their parents, as when we're displaying a county, we need the code of the parent to make the "Back to parent" link work. But when we're displaying a region, we don't care about the parent objects of the containing counties: not only don't we need to create links for them, but we already know the code - it's the code of the region we're currently displaying. Jackson, the JSON generation library, by default displays all properties of an object - that is, it looks for all getter methods on a class and calls all of them in turn. There are several ways this can not end up with what we want. First, if regions have counties as children and counties have regions as parents (a so-called bidirectional association ) then the "call all getters recursively" strategy ends up in an infinite loop (in practice, it crashes with a stack overflow). Secondly, if we call a getter on something that Hibernate hasn't fetched yet with a JOIN, then what the getter actually returns is a Hibernate proxy object, that in turn responds to calls to its getters by firing off a new SQL query to fetch the requested data. Hibernate's proxy objects are a good solution to simple cases of the extent problem: when fetching a region, don't load the counties by default, but load them in a separate query if someone actually tries to access them later on. Unfortunately, especially combined with a "fetch all getters" JSON renderer, this gets you the N+1 problem as we already discussed earlier. Assuming we fetch just children, not parents to avoid the infinite loop, then even if Hibernate is clever enough to use a single query to get all the counties in a region, when the JSON renderer loops over each county to get the wards (which we don't want in the first place when displaying a region!) that's one query per county, so the N+1 problem in action. My recommended solution here is the following line in src/main/resources/application.properties: spring.jpa.open-in-view=false This turns off the proxy objects' ability to load data later on: a call to load data that was not JOINed to start with now causes an exception. This is a good thing: you will immediately notice any extent problems (because they crash your application) and you can go and adjust your HQL queries to fix the problem. You can even write unit tests to make sure all your methods run correctly, whereas there is no easy way to write a unit test for "did this method only use 1-2 SQL queries to load its data". To really solve the problem, we have to tell jackson which properties we want in our JSON, and again the answer is "it depends": when we're displaying a region, we do want the region's counties; when we're displaying a country, we want the regions but not the counties. In the ModelClass base class for our domain classes, we customise exporting to JSON: // ModelClass.java public static <T> String renderJSON(T element, Class<T> cls, String id) { if (element == null) { throw new NoSuchElementException(cls, id); } try { return new ObjectMapper() .writerWithView(cls) .writeValueAsString(element); } catch (JsonProcessingException e) { throw new RuntimeException(e); }
} The key call here is writerWithView(cls) that creates a JSON writer for a particular view , allowing you to have more than one view per class. In this case we choose to reuse the domain classes as the views, namely, when we are viewing the contents of e.g. a region, then the view class is simply Region. We can now declare attributes to have a @JsonView: // Region.java @ManyToOne(fetch = FetchType.LAZY) @JoinColumn(name="parent")
@JsonView(Region.class)
private Country parent; @OneToMany(fetch = FetchType.LAZY, mappedBy = "parent")
@JsonView(Region.class)
private List<County> counties; Jackson will only export an attribute if the view class is equal to, or a subclass of, the class requested in the code above so we now have the following situation: When we are viewing a region, the view class is Region so the region's parent and children (counties) will be included in the JSON. When we are viewing a country, the view class is Country so the parents and children of the country's regions will not be included in the JSON.

