} The regions don't show their parent, but they do show the parentCode. We don't need this for the application, this feature is more for demonstration purposes. How does this work? Doesn't the following code require the parent to be loaded? public String getParentCode() { return parent.getCode(); } The answer is no, for two reasons. First, the reason that these regions were fetched here at all is that they were children of the current country. Hibernate knows that the country.regions and region.parent match up (we told it with JPA annotations, after all) so it could figure out the parent in this case anyway. For the second reason, try and manually visit the page localhost:8000/api/regions which is not used by the react client. This is handled by RegionController.getAllRegions: @GetMapping("/api/regions")
List<Region> getAllRegions() { return repository.findAll();
} This in turn calls the RegionRepository.findAll method which is implemented inside JPA/Hibernate itself (you won't see it in the RegionRepository class itself, it's declared on the parent class JpaRepository). You can see the SQL query it ends up producing in the log output: select region0_.code as code1_2_, region0_.name as name2_2_, region0_.parent as parent3_2_
from Region region0_ There is no JOIN with the parent (country) class going on here. In the JSON output, which does not use the ModelClass method of selecting an extent explicitly, it just returns a List<Region> which spring takes as a cue to pass through jackson to create JSON (shown here pretty-printed and abbreviated): [ { "code":"E12000001", "name":"North East", "parent":null, "counties":null, "parentCode":"E92000001" }, { "code":"E12000002", "name":"North West", "parent":null, "counties":null, "parentCode":"E92000001" }, /* and the others ... */
] The parent and counties attributes are null because we haven't explicitly excluded them, yet jackson also can't fetch them because they were not JOINed in the original query and we have turned off "open session in view" which would allow them to be fetched when jackson asks for them. Jackson and hibernate work well enough together not to cause a crash here: jackson notices that the objects are hibernate proxies and first asks behind the scene "are these attributes available?" before trying to call e.g. parent.getName(). So why does the following succeed? Think about it for a few moments. // Region.java public String getParentCode() { return parent.getCode(); } The answer is that the parent's code, but not the other attributes, is stored as a foreign key in the Region table, so the SQL query above actually does fetch the parent code. When hibernate creates a Region object and the parent / counties are not included in a JOIN, it will replace the parent and counties with hibernate proxy classes that roughly do the following: If "open session in view" (configuration line spring.jpa.open-in-view in application.properties) is turned on (this is the default) then the proxies run another SQL query to get the required data whenever someone asks for it, e.g. calls getName() on the parent proxy. If "open session in view" is turned off, and someone asks for data that is not loaded yet, throw an exception. Alternatively, libraries like jackson who notice the proxy objects can also ask "is this data available?" which is why the JSON returns "null" for the parent / counties in this case. But since the parent code, unlike the rest of the parent data, was loaded in the original query, hibernate actually creates a proxy object here that stores this code and returns it if someone calls getCode() on the parent proxy. Only on the other methods like getName() where the data is not loaded yet, do you get an exception.
